export const initialState = {
  basket: [],
  user: null,
};

function Reducer(state, action) {
  console.log(action);
  switch (action.type) {
    case "ADD_TO_BASKET":
      return { state };
      break;
    case "REMOVE_FROM_BASKET":
      return { state };
      break;
    default:
      return state;
  }
}

export default Reducer;
